function dataTableMaison(){var a=$("#searchPublications").val().toLowerCase();a=a.replace(/\s/g,"");for(var e=new RegExp("\\w*"+a+"\\w*"),n=$("#ContentPlaceHolder1_publicationsPortfolio").children(),t=n.length,i=0;i<t;i++){var o=n[i].children[0].children[0].textContent.toLowerCase();o=o.replace(/\s/g,""),e.test(o)?n[i].style.display="initial":n[i].style.display="none"}}$("#searchPublications").keyup(function(){dataTableMaison()}),$("#searchPublications").on("paste",function(){dataTableMaison()});